import React from 'react'
import image1 from "../assets/img/1735520059.webp"
import image2 from "../assets/img/pexels-w-rugby-6373836.jpg"


const MainArticle = () => {
  return (
    <section>
      <picture>
        <source srcSet={image1} media="(max-width: 640px)" />
        <source srcSet={image2} media="(min-width: 641px)" />
        <img src={image1} alt="image article" />
      </picture>
    </section>
  )
}

export default MainArticle;
